        graph[char].append(char)


    def check_generation(s, graph):
        visited = set()
        q = ["q0"]

        while q:
            node = q.pop(0)
            if node in visited:
                continue
            visited.add(node)

            if node in graph:
                for neighbor in graph[node]:
                    q.append(neighbor)

        return len(visited) == len(graph)

    print(check_generation(s, graph))

solve()
